unsigned int SPN(unsigned int k, unsigned int plaintext, unsigned int ciphertext, int mode) {
	for (int i = 0; i < 3; i++) {
		if (mode == 1) {
			if(i == 0)
				plaintext ^= ((k >> (4 * i)) & 0xffff);
			else
				plaintext ^= permutation[mode][(k >> (4 * i)) & 0xffff];
		}
		else
			plaintext ^= ((k >> (16 - 4 * i)) & 0xffff);
		plaintext = substitution[mode][plaintext & 0xf] | ((substitution[mode][(plaintext & 0xf0) >> 4]) << 4) | ((substitution[mode][(plaintext & 0xf00) >> 8]) << 8) | ((substitution[mode][(plaintext & 0xf000) >> 12]) << 12);
		plaintext = permutation[mode][plaintext];
	}
	if (mode == 1)
		plaintext ^= permutation[mode][(k >> 12) & 0xffff];
	else
		plaintext ^= ((k >> 4) & 0xffff);
	plaintext = substitution[mode][plaintext & 0xf] | ((substitution[mode][(plaintext & 0xf0) >> 4]) << 4) | ((substitution[mode][(plaintext & 0xf00) >> 8]) << 8) | ((substitution[mode][(plaintext & 0xf000) >> 12]) << 12);

	if (mode == 1)
		plaintext ^= ((k>>16) & 0xffff);
	else
		plaintext ^= (k & 0xffff);
	//printf("%04x", plaintext);
	return (plaintext == ciphertext);
}
inline unsigned int read()
{
	unsigned int x = 0;
	char c = getchar();
	while (c != ' ' && c != '\n') {
		x = x * 16 + ((c >= 'a') ? (c - 'a' + 10) : (c - '0'));
		c = getchar();
	}
	return x;
}
